\u0412\u043e\u043f\u0440\u043e\u0441 15.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Кофе заказывали по цвету - каждому тону кофе соответствовал свой номер,
чтобы гость мог простейшим способом заказать кофе по собственному вкусу;
тур окончен - самое время в перерыве выпить чашечку кофе или чая. :-)

\u0412\u043e\u043f\u0440\u043e\u0441 13.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Достигнув Ла-Платы, эскадра Магеллана начала продвигаться на юг,
исследуя берег; на этом пути европейцы впервые увидели пингвинов;
завершить "круг" адмиралу так и не удалось - он погиб на Филиппинах.
